;; @@
(defn linspace [start end & [steps]]
  "generates a vector of steps length
  (default 100) of equally spaced points
  between start and end"
  (let [incr (/ (- end start)
                (- (or steps 100) 1))]
    (if (> incr 0)
      (loop [cur (+ start incr)
             ret [start]]
        (if (> cur end)
          ret
          (recur (+ cur incr)
                 (conj ret cur)))))))
