;; @@
(def data [[0.0  0.5 ]
           [1.0  0.4 ]
           [2.0  0.2 ]
           [3.0 -0.05]
           [4.0 -0.2 ]
           [5.0  0.1 ]])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gp/data</span>","value":"#'gp/data"}
;; <=

;; @@
(with-primitive-procedures [linspace]
  (defquery gp []
    (let [belief (normal 0 1)
          positive-belief (gamma 1 1)

         ;; kernel function parameters
          d (sample positive-belief)
          e (sample positive-belief)

         ;; the mean function: 0 here
          m (fn [x] 0)

         ;; the kernel function: d·exp(-(x-y)²/2e)
          k (fn [x y]
              (let [dx (- x y)]
                (* d (exp (- (/ (* dx dx) 2. e))))))

         ;; observe and absorb each observation point
          gp (reduce
               (fn [gp point]
                 (let [d (produce gp)]
                   (observe (d (first point)) (second point))
                   (absorb gp point)))
               (GP m k) data)

         input (linspace -1 10 101)

         f (loop
              [gp gp
               xs input
               ys []]
              (if (not (empty? xs))
                (let [x (first xs)
                      d (produce gp)
                      y (sample (d x))]
                  (recur gp (rest xs) (conj ys y)))
                (map vector input ys)))]

     ;; predict gp hyperparameters and function evaluation at new input points
      {:d d :e e :f f})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gp/gp</span>","value":"#'gp/gp"}
;; <=

;; @@
(def samples (take-nth 100 (drop 500 (doquery :ipmcmc
                                       gp
                                       []
                                       :number-of-particles 100))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gp/samples</span>","value":"#'gp/samples"}
;; <=

;; @@
(map #(compose
        (list-plot % :joined true)
        (list-plot data :color "#000000"))
     (->> (take 10 samples) (map :result) (map :f)))
