(defn mean-func [[a b c] x]
  (+ c (* x (+ b (* x a)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gp/mean-func</span>","value":"#'gp/mean-func"}
;; <=

;; @@
(def num-particles 10)
(def csis-states (take num-particles (infer :csis gp [data] :tcp-endpoint "tcp://localhost:6666")))
(compose
  (list-plot data)
  (apply compose
         (mapv (fn [[abc weight]] (plot (partial mean-func (vec (vals abc))) [0 5]
                                        ;:opacity weight
                                        :color "red")) 
               (vec (empirical-distribution (collect-results csis-states))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gp/csis-states</span>","value":"#'gp/csis-states"}
;; <=

