(def num-particles 100)
(def is-states (take num-particles (infer :smc gp [(take 2 data)] :number-of-particles 100)))
(compose
  (list-plot data)
  (apply compose
         (mapv (fn [[abc weight]] (plot (partial mean-func (vec (vals abc))) [0 5]
                                        :opacity weight
                                        :color "red")) 
               (vec (empirical-distribution (collect-results is-states))))))
